(function(){document.querySelectorAll(".modal-effect").forEach(t=>{t.addEventListener("click",function(e){e.preventDefault();let c=this.getAttribute("data-bs-effect");document.querySelector("#modaldemo8").classList.add(c)})}),document.getElementById("modaldemo8").addEventListener("hidden.bs.modal",function(t){let e=this.classList.value.match(/(^|\s)effect-\S+/g);e=e[0].trim(),this.classList.remove(e)})})();
